import logo from './logo.svg';
import './App.css';
import {Head} from './container/head'


const dataTable = (
    <table>
      <tr>
        <th>Name</th>
        <th>Age</th>
      </tr>
      <tr>
        <td>Naveen</td>
        <td>25</td>
      </tr>
      <tr>
        <td>Sunil</td>
        <td>24</td>
      </tr>
    </table>
  );

function App() {
  return (

    <div className="App">
      <Head />
      {dataTable}
    </div>
  );
}

export default App;
